import {Routes, Route} from 'react-router-dom';
import { AppRoute } from '../../const';
import MainPage from '../../pages/main/main';

function App(): JSX.Element {
  return (
    <Routes>
      <Route
        path={AppRoute.Main}
        element={<MainPage />}
      />
    </Routes>
  );
}

export default App;
